En The Factory, el cofundador de Bone Soda, Skinny Macho, se unir\u00e1 a un invitado especial que a\u00fan no se ha anunciado, mientras que el cofundador de Fade to Mind, Kingdom, se enfrentar\u00e1 cara a cara con KG. Mi-el, residente de Late Night Shopper, tambi\u00e9n se unir\u00e1 a B2B con Benton.\n\nEl Mezzanine, mientras tanto, contar\u00e1 con dos colectivos de clubes LGBTQ+, PXSSY PALACE y Howl, as\u00ed como pole dance cortes\u00eda del colectivo HARPIES. \n\nLas entradas ya est\u00e1n a la venta.\n\nLa creaci\u00f3n de Nathanael Williams, Color Factory es un club nocturno, un lugar de m\u00fasica en vivo, un patio de comidas y un lugar multifuncional. Se cree que es el lugar de m\u00fasica propiedad de negros m\u00e1s grande del este de Londres y se enorgullece de su programaci\u00f3n inclusiva, de apoyo y diversa y de su \u00e9nfasis en la seguridad y la libertad de expresi\u00f3n. Lanzado en abril del a\u00f1o pasado, el club, que antes era Mick's Garage, seleccion\u00f3 recientemente a Ahadadream, Danielle, Mecha tok y Shannen SP como sus cuatro residentes para 2022.\n.\n.\n.\n#music #musica #musician #livemusic #newmusic #instamusic #edm"}}]},"shortcode":"Cf4Os9RsWY6","edge_media_to_comment":{"count":4},"taken_at_timestamp":1657556681,"dimensions":{"height":1080,"width":1080},"display_url":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/292922668_713483933063922_5382170404905868228_n.jpg?stp=dst-jpg_e35_s1080x1080\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u0026_nc_ohc=6oEqMn4_I50AX9JPekr\u0026edm=ABZsPhsBAAAA\u0026ccb=7-5\u0026oh=00_AT9hF5sUM1reOZoMIoITN-KusokUSQdmmFcU8bMX87022Q\u0026oe=62D31DB6\u0026_nc_sid=4efc9f","edge_liked_by":{"count":3},"edge_media_preview_like":{"count":3},"owner":{"id":"1640469529"},"thumbnail_src":"https://instagram.flos1-1.fna.fbcdn.net/v/t51.2885-15/292922668_713483933063922_5382170404905868228_n.jpg?stp=dst-jpg_e35_s640x640_sh0.08\u0026_nc_ht=instagram.flos1-1.fna.fbcdn.net\u0026_nc_cat=106\u002